import React, { Component } from 'react';
import GetLocalPosts from '../components/LocalPosts/GetLocalPosts';

class App extends Component {
  render() {
    return (
      <div className="">
        <h1 className="header">Local Storage</h1>
        <GetLocalPosts/>
        <br/>
      </div>
    );
  }
}

export default App;
